import "./Register.css";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

function Register() {

    const[username, setUsername] = useState("");
    const[name, setName] = useState("");
    const[password, setpassword] = useState("");
    const[confirmpassword, setConfirmpassword] = useState("");
    const[email, setEmail] = useState("");
    const[gender, setGender] = useState("");
    const[dateofbirth, setDateofbirth] = useState("");
    const [error, setError] = useState("");
    const [success, setSuccess] = useState("");
    const navigate = useNavigate();

    useEffect(()=>{
        navigate('/Register')
    },[navigate])

  return (
    <div className="register">
        <span className="registerTitle">Register</span>
        <form className="registerForm" >
            <div className="formGroup">
                <label>Name:</label>
                <input className="registerInput" type="text" id="name" name="name" value={name} onChange={(e) => setName(e.target.value)}/>
            </div>
            <div className="formGroup">
                <label>Email:</label>
                <input className="registerInput" type="email" id="email" name="email" value={email} onChange={(e) => setEmail(e.target.value)} />
            </div>
            <div className="formGroup">
                <label>Date of Birth:</label>
                <input className="registerInput" type="date" id="date_of_birth" name="date_of_birth" value={dateofbirth} onChange={(e) => se(e.target.value)} />
            </div>
            <div className="formGroup">
                <label>Gender:</label>
                <select className="registerInput" id="gender" name="gender" value={gender}>
                    <option value="">Select Gender</option>
                    <option value="Male">Male</option>
                    <option value="Female">Female</option>
                    <option value="Other">Other</option>
                </select>
            </div>
            <div className="formGroup">
                <label>Username:</label>
                <input className="registerInput" type="text" id="username" name="username" value={username} />
            </div>
            <div className="formGroup">
                <label>Password:</label>
                <input className="registerInput" type="password" id="password" name="password" value={password} />
            </div>
            <div className="formGroup">
                <label>Confirm Password:</label>
                <input className="registerInput" type="password" id="confirmpassword" name="confirmpassword" value={confirmpassword} />
            </div>
            <button type="submit" className="registerButton">Register</button>
        </form>
    </div>
  )
}

export default Register
